import { Link } from 'react-router-dom';
import axios from 'axios';

export default function EntryList(){
  const [goals, setGoals] = useState([])
//   const [exercisesEG, setExercisesEG] = useState([
//     {username: "a",
//     description: "test1",
//     duration: "test1",
//     date: "12/12/12",
//     _id: "1111"}
//   ])
  

  useEffect(() => {
    axios.get('http://localhost:5000/goals/')
      .then(response => (setGoals(response.data)))
  },[])

//   function deleteExercise(id){
//     axios.delete('http://localhost:5000/goals/' + id)
//       .then(response => { console.log(response.data)});

//     setGoals([...goals, goals.filter(el => el._id !== id)])
//   }


  function GoalList() {
    return (goals.map(currentGoal => {

      const {title, description, milestones,  _id} = currentGoal
      return (
        <tr key={_id} >
          <td>{title}</td>
          <td>{description}</td>
          <td>{milestones}</td>
          {/* <td>
            <Link to={"/edit/"+_id}>edit</Link> | <a href="#" onClick={() => { deleteGoal(_id) }}>delete</a>
          </td> */}
        </tr>
      )
      
    })
  )}
  
    return (
      <div>
        <h3>Logged Goals</h3>
        <table className="table">
          <thead className="thead-light">
            <tr>
              <th>Title</th>
              <th>Description</th>
              <th>Milestones</th>
            
              {/* <th>Actions</th> */}
            </tr>
          </thead>
          <tbody>
            <GoalList/>
          </tbody>
        </table>
      </div>
    )
 
}
